import React from "react";

function Card(props){
    return(
        <div className="card">
            <div className="top">
                <h2 className="name">Beyonce</h2>
                <img
                    className="circle-img"
                    src={props.img}
                    alt="avatar_img"
                />
        </div>
        <div className="bottom">
          <p className="info">+123 456 789</p>
          <p className="info">b@beyonce.com</p>
        </div>
      </div>
    );  
}
export default Card;
